import React, { useState, useEffect } from "react";
import axios from "axios";

const YoutubeVideo = () => {
  const [videoId, setVideoId] = useState("");
  const [videoTitle, setVideoTitle] = useState("");

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        `https://www.googleapis.com/youtube/v3/search?part=snippet&q=dogs&key=AIzaSyD7oceCmTfzCji0ORDsO5PwiIUuWe6nCF8`
      );
      setVideoId(result.data.items[0].id.videoId);
      setVideoTitle(result.data.items[0].snippet.title);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h1>{videoTitle}</h1>
      <iframe
        width="560"
        height="315"
        src={`https://www.youtube.com/embed/${videoId}`}
        frameborder="0"
        allow="autoplay; encrypted-media"
        allowfullscreen
      ></iframe>
    </div>
  );
};

export default YoutubeVideo;
